async function cp_readme_md() {
  // 在当前目录生成README文件夹
  // 创建backup文件夹
  if (!fs.existsSync(path.join(__dirname, "README"))) {
    fs.mkdirSync(path.join(__dirname, "README"));
  }

  let origin_readme_file_pathname = path.join(
    __dirname,
